import React from "react";


const footer = () => {

    return(
<footer>
<a href="#"><i class="fa-brands fa-square-instagram"></i></a>
<a href="#"><i class="fa-brands fa-github"></i></a>
<a href="#"><i class="fa-brands fa-twitter"></i></a>
</footer>
    )
}

export default footer;
